import { Link } from 'react-router-dom';
import styled from 'styled-components'

const Ul = styled.ul`
        
    margin-left: auto;
    margin-right: 50px;
    flex-flow: row rowrap;
    display: flex;
    list-style: none;


    li{
        color: white;
        margin-left: 40px;
        text-decoration: none;
        padding: 10px;
    }
    .links a:hover {
        color: #f1356d;
    }
    @media (max-width: 700px){
        flex-flow: column rowrap;
        background-color: green;
    }
`;

const RightNav = () => {
    return ( 
        <Ul>
            <li>Home</li>
            <li>About Us</li>  
        </Ul>
    );
}
 
export default RightNav;
